import About from './Components/About';
import Language from './Components/Language';
import logo from './image/logo.jpg';
import { ToastContainer } from 'react-toastify';
import Header from './Components/Header';

function App() {
  return (
    <>
        <div>
            <ToastContainer />
            <container>
                <Header />
            </container>
        </div>

    </>
);
}

export default App;
